using AEAssist;
using AEAssist.CombatRoutine;
using AEAssist.CombatRoutine.Trigger;
using AEAssist.CombatRoutine.Trigger.Node;
using AEAssist.Extension;
using AEAssist.MemoryApi;

namespace Aki.timelinetriggers.Dash
{
    public class TriggerAction_Dash : ITriggerScript
    {
        public bool Check(ScriptEnv scriptEnv, ITriggerCondParams condParams)
        {
            if (Core.Resolve<MemApiSpell>().GetCharges(34646) >= 1  &&
                Core.Me.Distance(Core.Me.GetCurrTarget()!) > SettingMgr.GetSetting<GeneralSettings>().AttackRange)
            { return true; }

            return false;
        }
    }
}

